const Button = ({color, text}) => {
    let a = 0;
    const onClick = (e) => {
        console.log('hello' + ' ' + a);
        a += 1;
    }
    return (
            <button 
            onClick={onClick}
            className='btn' style={{backgroundColor: color}}>{text}</button>
    )
}

